import { Box, Button, Stack } from "@mui/material";

const pages = ["Products", "Pricing", "Blog"];
const settings = ["Profile", "Account", "Dashboard", "Logout"];

export const StructureSelect = () => {
  return (
    <Box>
      <Box>
        <Stack>
          {pages.map((page) => (
            <Button variant="outlined">Outlined</Button>
          ))}
        </Stack>
      </Box>
    </Box>
  );
};
